(1, 7, 'BB Cream - CC Cream - Kem Nn - TFS', 'CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++', 'CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--', 'Xut x: Thefaceshop - Korea.', '<p><a title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--"><span style="font-size: small;"><strong>CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++</strong></span></a></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">Trng Lng: 20g</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">Sau th&agrave;nh c&ocirc;ng ca </span><a title="Face It Aura Color Control Cream" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/CC-Cream-Aura-Color-Control-Cream-Thefaceshop"><strong style="font-family: arial, helvetica, sans-serif; font-size: small;">Face It Aura Color Control Cream</strong></a><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"> ra mt u nm nay, Thefaceshop va tung ra d&ograve;ng </span><a title="CC Cream Aqua" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--"><strong style="font-family: arial, helvetica, sans-serif; font-size: small;">CC Cream Aqua</strong></a><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;mi tinh n&agrave;y vi kh nng vt bc hn:</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chng nng SPF 50+ hn c kem chng nng hng ng&agrave;y bo v l&agrave;n da di nng mt tri.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chng thm nc gi&uacute;p gi lp trang im c ng&agrave;y d&agrave;i.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+C ch l&agrave;m m&aacute;t mi gi&uacute;p gim nhit cho da (gim nhit b mt n 2  C so vi nhit  c th) th&iacute;ch hp cho make up ban ng&agrave;y, thoi m&aacute;i ra nng m&agrave; kh&ocirc;ng lo da b bng r&aacute;t v&agrave; b tia UV tn c&ocirc;ng na.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chc nng c&acirc;n chnh m&agrave;u da, cho lp nn u m&agrave;u v&agrave; n&acirc;ng t&ocirc;ng da s&aacute;ng hn mt c&aacute;ch t nhi&ecirc;n. Cht kem khi &aacute;nh l&ecirc;n da s t ng chuyn m&agrave;u ph&ugrave; hp vi da bn, c&acirc;n bng nhng v&ugrave;ng s&aacute;ng ti tr&ecirc;n da v&agrave; che ph khuyt im.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;">C&oacute; 2 tone m&agrave;u: 01 - m&agrave;u s&aacute;ng v&agrave; 02 - t nhi&ecirc;n.</span></span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"><span style="font-size: small; font-family: arial, helvetica, sans-serif; color: #000000;"><img title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++ 1" src="/uploads/img_product_detail/CC-CreamThefaceshopAquaUVColorControlCreamSPF50%20%281%29.jpg" alt="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++ 1" width="604" height="475" /></span></span></p>\r\n<p>&nbsp;</p>', '2014_02_25_20_38_03-shopmyphamhan-CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA++.jpg', 440000, 420000, 'CCTFS02', 1, '0', 0, 0, '1', '1', '1', 1385538227),
