(96, 45, 'Sa Ra Mt - TFS', 'Sa Ra Mt Go Rice Water Bright Cleansing Foam', 'Sua-Rua-Mat-Gao-Rice-Water-Bright-Cleansing-Foam', 'Xut x : Thefaceshop - Korea.\r\nSa Ra Mt Go lm sch v sng da, lu lai  m cho da.', '<p><strong><span style="font-size: small;">Sa Ra Mt Go Rice Water Bright Cleansing Foam</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 150ml.</span></p>\r\n<p><span style="font-size: small;"><span><strong><span>Rice Water Bright Cleansing Foam&nbsp;</span></strong>l&agrave; sn phm sa ra mt chit xut t nc go v&agrave; du thc vt Moringa, gi&uacute;p ly sch ho&agrave;n to&agrave;n bi bn v&agrave; b&atilde; nhn s&acirc;u trong l ch&acirc;n l&ocirc;ng cho l&agrave;n sch v&agrave; s&aacute;ng khe. Vi kt cu dng kem mn, d to bt, to cm gi&aacute;c trn l&aacute;ng, mm mn sau khi ra mt.</span></span></p>\r\n<p><span style="font-size: small;"><strong>Sa ra mt go Thefaceshop</strong> gi&uacute;p <strong>l&agrave;m sch v&agrave; s&aacute;ng da,</strong> lu lai &ocirc; &acirc;m cho da sau khi s dung.</span></p>\r\n<p><span style="font-size: small;">C&aacute;ch s dng:</span></p>\r\n<p><span style="font-size: small;">S dng sau ty trang. To bt sn phm, massage khong 30 gi&acirc;y n 1 ph&uacute;t v&agrave; ra sch li vi nc</span></p>', '2014_02_28_13_47_03-shopmyphamhan-Sua-rua-mat-gao-rice-water-bright-cleansing-foam.jpg', 190000, 180000, 'SRMTFS1', 1, '0', 0, 0, '1', '1', '1', 1393566376),
(97, 45, 'Sa Ra Mt - TFS', 'Sa Ra Mt Go Rice Warer Bright Rice Bran Cleansing Foam', 'Sua-Rua-Mat-Gao-Rice-Warer-Bright-Rice-Bran-Cleansing-Foam', 'Xut x : Thefaceshop - Korea.\r\nSa Ra Mt Go loai bo t bao cht v lm sch, sng da.', '<p><strong><span style="font-size: small;">Sa Ra Mt Go Rice Warer Bright Rice Bran Cleansing Foam</span></strong></p>\r\n<p><strong><span style="font-size: small;"><strong><span>Rice Warer Bright Rice Bran Cleansing Foam </span></strong></span></strong><span style="font-size: small;">th&iacute;ch hp cho mi loi da.</span></p>\r\n<p><span style="font-size: small;">Sa ra mt go gi&uacute;p <strong>loai bo t&ecirc; bao ch&ecirc;t</strong> nhe nhang,<strong> l&agrave;m sch v&agrave; s&aacute;ng da</strong>, lu lai &ocirc; &acirc;m cho da sau khi s dung.</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch s dng:&nbsp;</span></span></p>\r\n<p><span style="font-size: small;">S dng sau ty trang. To bt sn phm, massage khong 30 gi&acirc;y n 1 ph&uacute;t v&agrave; ra sch li vi nc.</span></p>', '2014_02_28_13_49_53-shopmyphamhan-Sua-rua-mat-gao-rice-water-bright-rice-bran-cleansing-foam.jpg', 205000, 195000, 'SRMTFS2', 1, '0', 0, 0, '0', '1', '1', 1393567001),
(98, 45, 'Sa Ra Mt - TFS', 'Sa ra mt trng da White Tree Snow Exfoliating Foam Cleanser', 'Sua-rua-mat-trang-da-White-Tree-Snow-Exfoliating-Foam-Cleanser', 'Xut x : Thefaceshop - Korea.\r\nSa ra mt White Tree Snow lm sch t bo cht v lm trng da.', '<p><strong><span style="font-size: small;">Sa ra mt trng da White Tree Snow Exfoliating Foam Cleanser</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 140ml.</span></p>\r\n<p><span style="font-size: small;"><span><strong>White Tree Snow</strong>&nbsp;</span>chit xut t c&aacute;c th&agrave;nh phn:</span></p>\r\n<p><span style="font-size: small;">- C&acirc;y Vitamin cha: Vitamin C (Gp 200 ln lng vitamin C trong 1 tr&aacute;i t&aacute;o). Gi&uacute;p da phc hi t&iacute;nh &agrave;n hi, loi b t b&agrave;o cht nh nh&agrave;ng, ph&ograve;ng nga np nhn xut hin. Ngn nga v&agrave; loi tr vt th&acirc;m en, loi tr c&aacute;c sc t ra ngo&agrave;i c th, mang li l&agrave;n da sang mn v&agrave; khe mnh; 18 ax&iacute;t amin thit yu, axit tr&aacute;i c&acirc;y gi&uacute;p iu ho&agrave; li v&ograve;ng tun ho&agrave;n</span></p>\r\n<p><span style="font-size: small;">- Flavonoid gi&uacute;p chng li qu&aacute; tr&igrave;nh oxy ho&aacute;.</span></p>\r\n<p><span style="font-size: small;">- Arbutin: Chit xut t c&acirc;y dng mai, l&agrave; th&agrave;nh phn l&agrave;m trng da ni ting.</span></p>\r\n<p><span style="font-size: small;">Sa ra mt co hat giup <strong>l&agrave;m sch t b&agrave;o cht</strong> nhe nhang v&agrave; <strong>l&agrave;m trng s&aacute;ng da.</strong></span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch s dng :</span></span></p>\r\n<p><span style="font-size: small;">S dng sau ty trang. To bt sn phm, massage khong 30 gi&acirc;y n 1 ph&uacute;t v&agrave; ra sch li vi nc.</span></p>', '2014_02_28_13_57_41-shopmyphamhan-Sua-rua-mat-Trang-da-white-tree-snow-exfoliating-foam-cleanser.jpg', 220000, 190000, 'SRMTFS3', 1, '0', 0, 0, '1', '1', '1', 1393567416),
(99, 45, 'Sa Ra Mt - TFS', 'Sa Ra Mt Tr Mn Clean Face Acne Solution Foam Cleanser', 'Sua-Rua-Mat-Tri-Mun-Clean-Face-Acne-Solution-Foam-Cleanser', 'Xut x : Thefaceshop - Korea.\r\nSa Ra Mt chit xut t cy tr c bit dnh cho da du, da mn.', '<p><span style="font-size: small;"><strong><span style="text-decoration: underline;">Sa Ra Mt Tr Mn Clean Face Acne Solution Foam Cleanser</span></strong></span></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 150ml.</span></p>\r\n<p><span style="font-size: small;">Sa ra mt tr mun gi&uacute;p <strong style="font-size: small;">l&agrave;m sch l&agrave;n da v&agrave; kim du&nbsp;</strong>vi thanh ph&acirc;n <strong style="font-size: small;">khang khu&acirc;n t c&acirc;y tra.</strong></span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">&nbsp;C&aacute;ch s dng:</span></span></p>\r\n<p><span style="font-size: small;">S dng sau bc ty trang. Dung m&ocirc;t lng va u, tao bot va thoa nhe nhang khp mt. Ra lai vi nc &acirc;m.</span></p>', '2014_02_28_14_00_08-shopmyphamhan-Sua-rua-mat-tri-mun-clean-face-Acne-solution-foam-cleansing.jpg', 195000, 190000, 'SRMTFS4', 1, '0', 0, 0, '0', '1', '1', 1393567787),
(100, 45, 'Sa Ra Mt - TFS', 'Sa Ra Mt Than en Phyto Powder In Cleasing Foam - Charcoal', 'Sua-Rua-Mat-Than-Den-Phyto-Powder-In-Cleasing-Foam---Charcoal', 'Xut x : Thefaceshop - Korea.\r\nSa Ra Mt Than en thch hp cho da du, da hn hp.', '<p><strong><span style="font-size: small;">Sa Ra Mt Than en Phyto Powder In Cleasing Foam - Charcoal</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch: 170ml.</span></p>\r\n<p><span style="font-size: small;"><strong>Sa ra mt Thefaceshop vi vi thanh ph&acirc;n b&ocirc;t than hoat tinh</strong> k&ecirc;t c&acirc;u r&ocirc;ng giup <strong>thanh lc c&aacute;c ch&acirc;t b&acirc;n va &ocirc;c t&ocirc; tr&ecirc;n da</strong>, cung cac hat than hoat tinh giup <strong>lam sach mn u en v&agrave; t&ecirc; bao ch&ecirc;t</strong> nhe nhang, em lai lan da ti sang.</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch s dng</span></span></p>\r\n<p><span style="font-size: small;">Ly mt lng va  ra l&ograve;ng b&agrave;n tay v&agrave; to bt k. Thoa &ecirc;u nhe nhang giup lam sach bui b&acirc;n tr&ecirc;n da. Ra sach ky vi nc.</span></p>', '2014_02_28_13_55_03-shopmyphamhan-Sua-rua-mat-than-den-phyto-powder-in-cleansing-foam-charcoal.jpg', 170000, 165000, '', 1, '0', 0, 0, '1', '1', '1', 1393568064),
(101, 45, 'Sa Ra Mt - TFS', 'Sa Ra Mt Calming Seed Mild Bubble Foam Cleanser', 'Sua-Rua-Mat-Calming-Seed-Mild-Bubble-Foam-Cleanser', 'Xut x : Thefaceshop - Korea.\r\nSa ra mt Calming Seed cho da nhy cm.', '<p><strong><span style="font-size: small;">Sa Ra Mt Calming Seed Mild Bubble Foam Cleanser</span></strong></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 150ml</span></p>\r\n<p><span style="font-size: small;">Sa ra mt <strong>Calming Seed l&agrave;m sch v&agrave; mn da</strong> vi chit xut t ht m&ugrave; u (tanamu) v&agrave; <strong>cam tho gi&uacute;p l&agrave;m du v&agrave; ngn nga k&iacute;ch ng cho l&agrave;n da.</strong></span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch s dng:</span></span></p>\r\n<p><span style="font-size: small;">Dung m&ocirc;t lng va u tao bot va m&aacute;t xa nhe nhang khp b mt da. Ra sch vi nc &acirc;m.</span></p>', '2014_02_28_13_44_28-shopmyphamhan-Sua-rua-mat-Calming-seed-Mild-Bubble-foam-Cleanser.jpg', NULL, 250000, 'SRMTFS5', 1, '0', 0, 0, '0', '1', '1', 1393568482);
